import { NavLink } from "react-router-dom";

const Botones = () => {
    const estilos = {
        Boton: "w-full  mx-5 bg-[#1b6102] border-[8px] rounded-xl border-[#2da202] border-double",
    }
    return (
        <main 
        // className="w-full flex h-16 mt-2"
        >
            <button className={estilos.Boton}>
            <p className="rotate-[-90deg]">PREVIOUS</p>
            </button>
            <div className="w-full flex justify-around ">
                <button className={estilos.Boton}>
                <NavLink to="Lista">List View</NavLink>
                </button>
                <button className={estilos.Boton}>
                    <NavLink to="Detalle">Details</NavLink>
                </button>
                <button className={estilos.Boton}>
                <NavLink to="Busqueda">Search</NavLink>
                </button>
                <button className={estilos.Boton}>
                <NavLink to="/">Close</NavLink>
                </button>
            </div>
            <button className={estilos.Boton}>
            <p className="rotate-[90deg]">NEXT</p>
            </button>
        </main>
    );
}

export default Botones;
